import React from 'react';

const SportsList = ({ sports }) => {
  return (
    <ul>
      {sports.map(sport => (
        <li key={sport.key}>
          <strong>{sport.title}</strong> - {sport.group} - {sport.active ? 'Active' : 'Inactive'}
        </li>
      ))}
    </ul>
  );
};

export default SportsList;
